import React from "react";
import "./nav.css";

const Nav = () => {
  const navBar = document.getElementById("navBar");
  const barOne = document.getElementById("barOne");
  const barTwo = document.getElementById("barTwo");
  const barThree = document.getElementById("barThree");
  const navLinkOne = document.getElementById("navLinkOne");
  const navLinkTwo = document.getElementById("navLinkTwo");
  const navLinkThree = document.getElementById("navLinkThree");
  const navBarFooter = document.getElementById("navBarFooter");
  // navOpen animation
  const open = () => {
    navBar.classList.add("nav-bar-open");
    navBar.classList.add("visible");
    barOne.classList.add("bar-one-transition");
    barTwo.classList.add("bar-two-transition");
    barThree.classList.add("bar-three-transition");
    setTimeout(() => {
      navLinkOne.classList.add("nav-link-fade-in");
      setTimeout(() => {
        navLinkTwo.classList.add("nav-link-fade-in");
        setTimeout(() => {
          navLinkThree.classList.add("nav-link-fade-in");
          setTimeout(() => {
            navBarFooter.classList.add("nav-link-fade-in");
          }, 200);
        }, 200);
      }, 200);
      navBar.removeClass("nav-bar-open");
      barOne.removeClass("bar-one-transition");
      barOne.classList.add("bar-one-hold");
      barTwo.removeClass("bar-two-transition");
      barTwo.classList.add("bar-two-hold");
      barThree.classList.add("bar-three-hold");
      barThree.removeClass("bar-three-transition");
    }, 300);
  };

  //navClose animation
  const close = () => {
    navLinkOne.removeClass("nav-link-fade-in");
    navLinkTwo.removeClass("nav-link-fade-in");
    navLinkThree.removeClass("nav-link-fade-in");
    navBarFooter.removeClass("nav-link-fade-in");
    navLinkOne.classList.add("nav-link-fade-out");
    navLinkTwo.addClass("nav-link-fade-out");
    navLinkThree.addClass("nav-link-fade-out");
    navBarFooter.addClass("nav-link-fade-out");
    setTimeout(() => {
      navBar.addClass("nav-bar-close");
      navBar.removeClass("nav-bar-open");
      barOne.addClass("bar-one-transition-out");
      barOne.removeClass("bar-one-hold");
      barTwo.addClass("bar-two-transition-out");
      barTwo.removeClass("bar-two-hold");
      barThree.addClass("bar-three-transition-out");
      barThree.removeClass("bar-three-hold");
      setTimeout(() => {
        navBar.removeClass("nav-bar-open");
        navBar.removeClass("nav-bar-close");
        navBar.removeClass("visible");
        barOne.removeClass("bar-one-transition-out");
        barTwo.removeClass("bar-two-transition-out");
        barThree.removeClass("bar-three-transition-out");
        navBarFooter.removeClass("nav-link-fade-out");
        navLinkOne.removeClass("nav-link-fade-out");
        navLinkTwo.removeClass("nav-link-fade-out");
        navLinkThree.removeClass("nav-link-fade-out");
      }, 300);
    }, 250);
  };

  //nav event listener
  const navToggleClick = () => {
    console.log("click");
    if (navBar.classList.contains("visible")) {
      close();
    } else {
      open();
    }
  };
  return (
    <div>
      <div id="navToggle" onClick={() => navToggleClick()}>
        <div id="barContainer">
          <div id="barOne"></div>
          <div id="barTwo"></div>
          <div id="barThree"></div>
        </div>
      </div>
      <nav id="navBar">
        <div class="nav-link-container">
          <div id="navLinkOne" class="nav-link">
            <a href="/">home</a>
          </div>
          <div id="navLinkTwo" class="nav-link">
            <a href="/about">about</a>
          </div>
          <div id="navLinkThree" class="nav-link">
            <a href="/contact">contact</a>
          </div>
        </div>
        <div id="navBarFooter" class="nav-bar-footer">
          <a
            href="https://www.linkedin.com/in/blueshiftwebdev"
            target="_blank"
            rel="noreferrer"
          >
            <i class="fab fa-linkedin"></i>
          </a>
          <a
            href="https://www.github.com/blueshiftwebdev"
            target="_blank"
            rel="noreferrer"
          >
            <i class="fab fa-github"></i>
          </a>
          <a
            href="https://www.twitter.com/blueshiftwebdev"
            target="_blank"
            rel="noreferrer"
          >
            <i class="fab fa-twitter"></i>
          </a>
        </div>
      </nav>
    </div>
  );
};
export default Nav;
